import React from 'react'

import { Navbar,Container,Button} from 'react-bootstrap'



    const Header = () => {
        return (
            <header>
                <Navbar bg="primary" variant="dark" expand="lg" collapseOnSelect> 
                    <Container>
                        <Navbar.Brand href="#home" >HistoryAgenda</Navbar.Brand>                  
                        <Button variant="outline-warning" justify-content="center">Create History</Button>{' '}
                    </Container>
                </Navbar>

            </header>
        );
    }


export default Header
